  false,\n\t\"url\": null,\n\t\"notes\": \"LIDAR data is remotely sensed high-resolution
  elevation data collected by an airborne collection platform. By positioning laser
  range finding with the use of 1 second GPS with 100 hz inertial measurement unit
  corrections; Terrapoint LIDAR instruments are able to make highly detailed geospatial
  elevation products of the ground, man-made structures and vegetation. The LiDAR
  flightlines for this project was planned for a 50 percent acquisition overlap. The
  nominal resolution of this project without overlap is 1.25 m. Four returns were
  recorded for each pulse in addition to an intensity value. GPS Week Time, Intensity,
  Flightline and number attributes were provided for each LiDAR point. Data is provided
  as random points, in LAS format, classified according to ASPRS Class Code 2=Ground
  1=Undefined.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
